pragma solidity ^0.5.0;

contract VehicleRegService {
   string driverid;
   string vehicleNo;
   string Address;
   string expirationdate;
   string renewaldate;

function setVehicleRegChange(string memory _driverid, string memory _vehicleNo,string  memory _Address,string memory _expirationdate,string memory _renewaldate) public {
      driverid = _driverid;
      vehicleNo= _vehicleNo;
      Address = _Address;
      expirationdate = _expirationdate;
      renewaldate = _renewaldate;
      
   }
   
   function getVehicleRegChange() public view returns (string memory,string memory,string memory,string memory,string memory) {
       return ( driverid,vehicleNo,Address,expirationdate,renewaldate);
   
   }
    
}
